With the app, you can: 
- Manage the Market Leaders you are following: add, remove, change settings, pause and so on;
- Gain access to detailed comprehensive analysis of Market Leaders'
performances to choose those that suit you best (you can analyze single performance as well as compare multiple performances);
- View and analyze history and statistics of your autotrade account;
- View your open trades and close them if needed;

